import React from "react";


class landing extends React.Component
{
        constructor(props) 
        {
                super(props);
        }

        render()
        {
          return (
                <div className="App">
                  <header className="App-header">
                    <p>
                      Register.
                    </p>
                    <div>
                      <form>
                        <div>Name: </div>
                        <input className="Nav_Base" type="text"  placeholder = "Name."  name="name"  />
                      </form>
                    </div>
                  </header>
                </div>
              );
        }
}

export default landing;
